set information such as namespace, schema, and so on for a given instance ID, namespace, and dataset name.</p>', 'GetInstance' => '<p>Enables you to programmatically retrieve the information related to an Amazon Web Services Supply Chain instance ID.</p>', 'ListDataIntegrationFlows' => '<p>Enables you to programmatically list all data pipelines for the provided Amazon Web Services Supply Chain instance.</p>', 'ListDataLakeDatasets' => '<p>Enables you to programmatically view the list of Amazon Web Services Supply Chain data lake datasets. Developers can view the datasets and the corresponding information such as namespace, schema, and so on for a given instance ID and namespace.</p>', 'ListInstances' => '<p>List all Amazon Web Services Supply Chain instances for a specific account. Enables you to programmatically list all Amazon Web Services Supply Chain instances based on their account ID, instance name, and state of the instance (active or delete).</p>', 'ListTagsForResource' => '<p>List all the tags for an Amazon Web ServicesSupply Chain resource. You can list all the tags added to a resource. By listing the tags, developers can view the tag level information on a resource and perform actions such as, deleting a resource associated with a particular tag.</p>', 'SendDataIntegrationEvent' => '<p>Send the transactional data payload for the event with real-time data for analysis or monitoring. The real-time data events are stored in an Amazon Web Services service before being processed and stored in data lake. New data events are synced with data lake at 5 PM GMT everyday. The updated transactional data is available in data lake after ingestion.</p>', 'TagResource' => '<p>You can create tags during or after creating a resource such as instance, data flow, or dataset in AWS Supply chain. During the data ingestion process, you can add tags such as dev, test, or prod to data flows created during the data ingestion process in the AWS Supply Chain datasets. You can use these tags to identify a group of resources or a single resource used by the developer.</p>', 'UntagResource' => '<p>You can delete tags for an Amazon Web Services Supply chain resource such as instance, data flow, or dataset in AWS Supply Chain. During the data ingestion process, you can delete tags such as dev, test, or prod to data flows created during the data ingestion process in the AWS Supply Chain datasets. </p>', 'UpdateDataIntegrationFlow' => '<p>Enables you to programmatically update an existing data pipeline to ingest data from the source systems such as, Amazon S3 buckets, to a predefined Amazon Web Services Supply Chain dataset (product, inbound_order) or a temporary dataset along with the data transformation query provided with the API.</p>', 'UpdateDataLakeDataset' => '<p>Enables you to programmatically update an Amazon Web Services Supply Chain data lake dataset. Developers can update the description of a data lake dataset for a given instance ID, namespace, and dataset name.</p>', 'UpdateInstance' => '<p>Enables you to programmatically update an Amazon Web Services Supply Chain instance description by providing all the relevant information such as account ID, instance ID and so on without using the AWS console.</p>', ], 'shapes' => [ 'AccessDeniedException' => [ 'base' => '<p>You do not have the required privileges to perform this action.</p>', 'refs' => [], ], 'AscResourceArn' => [ 'base' => NULL, 'refs' => [ 'DataLakeDataset$arn' => '<p>The arn of the dataset.</p>', 'ListTagsForResourceRequest$resourceArn' => '<p>The Amazon Web Services Supply chain resource ARN that needs tags to be listed.</p>', 'TagResourceRequest$resourceArn' => '<p>The Amazon Web Services Supply chain resource ARN that needs to be tagged.</p>', 'UntagResourceRequest$resourceArn' => '<p>The Amazon Web Services Supply chain resource ARN that needs to be untagged.</p>', ], ], 'AwsAccountId' => [ 'base' => NULL, 'refs' => [ 'Instance$awsAccountId' => '<p>The Amazon Web Services ac